import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'
function Home(){
  return (
    <h1>HomePage</h1>
  )
}
function App() {
  return (
    <BrowserRouter>
    <Link to='/'>Home </Link>
    <Link to='/about'> About </Link>
    <Routes>
      <Route path="/">
        <Route index element={<Home />} />
        <Route path='about' element={<h1>About Page</h1>}/>
      </Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
